import React from 'react'
import style from './index.module.scss'
export default function Index(props) {
  const cancelClick = () => { }
  const confirmClick = () => { }
  return (
    <div className={style.model_container}>
      <div className={style.model_main}>
        <div className={style.model_title}>{props.content}</div>
        <div className={style.model_content} ></div>
        <div className={style.model_buttons}>
          <button onClick={cancelClick} className={style.button}>ok</button>
          <button onClick={confirmClick} className={`${style.button} ${style.confirm}`}>cancel</button>
        </div>
      </div>
      <div className={style.model_mask}></div>
    </div >
  )
}
